import React from "react";
import { DefaultInput, Form, InlineForm, InputSeparator, Button, DefaultInputs } from "../form/inputs";
import Image from "./image";
import styled from "styled-components";


const ContentWrapper = styled("div")`
  display: grid;
  grid-template-columns: 455px 60%;


`;

const FormContainer = styled(Form)`
  padding: 0px 20px;
  position: relative;


`;
const CenteredForm = styled("div")`

  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);

`;

const Login = () => {
    return (
        <>
            <ContentWrapper>
                <Image />
                <FormContainer>
                    <CenteredForm>
                        <DefaultInputs
                            label="Phone number"
                            placeholder="Today"
                            id="date"
                        />

                        <Button>Next</Button>
                    </CenteredForm>
                </FormContainer>
            </ContentWrapper>
        </>
    );
};

export default Login;
